export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:g,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:g,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:h,pageSize:25,pageCount:h,total:5}}},hv47hufnOL:{data:{id:339,attributes:{imdbId:"tt0049016",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BM2IwOWExYzktMTUzMC00MDY2LTkwOTctZDlmYjg5MmU2NzU5XkEyXkFqcGdeQXVyOTMxMjU2Mg@@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"6.2\u002F10"}],item_lang:{data:{id:1002,attributes:{title:"Blackjack Ketchum, Desperado",plot:"While doing a good deed, the title hero has to shoot a man in self defense, and go into hiding. His peace is interrupted when a cattle baron rides into his territory, and decides to settle there. When no locals want to sell, Jared Tetlow turns to murdering the locals with his hired gun Dee Havalik, and starting a range war. Blackjack finds he has to kill the Tetlow gang off one by one, to restore peace in this movie sharing nothing in common with its real-name historical outlaw.",slug:"blackjack-ketchum-desperado"}}},books:{data:[{id:3151,attributes:{title:"The Kilkenny Series Bundle",description:"Discover one of Louis L’Amour’s most iconic heroes of the frontier: Lance Kilkenny, the reluctant gunslinger outrunning a bad reputation and a troubled conscience. One of the earliest creations from the master craftsman of Western fiction, Kilkenny featured prominently throughout the years in L’Amour’s work, his search for peace and quiet interrupted by one heart-stopping adventure after another. Now this rollicking eBook bundle collects the three full-length Kilkenny novels alongside three essential shorter pieces: KILKENNY THE RIDER OF LOST CREEK THE MOUNTAIN VALLEY WAR WEST OF DODGE (SHORT STORY) MONUMENT ROCK (NOVELLA) A GUN FOR KILKENNY (SHORT STORY) Kilkenny wasn’t looking for trouble when he entered the Clifton House stage station, but trouble found him when a reckless youngster named Tetlow challenged him, drew his gun, and paid for it with his life. Looking to escape a reputation that he never wanted, Lance Kilkenny settles in the lonely mountain country of Utah, planning to ranch a high, lush valley. But the past is on his trail. Jared Tetlow is a powerful rancher determined to run his vast herd on the limited grasslands there—whether he has to buy out the local ranchers, run them out, or kill them. He’ll cut down anyone who stands in his way, especially a man he already despises: the gunman named Kilkenny—the man who killed his son.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=h6LSCQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:true,published:"2015-07-07",publisher:d,subtitle:b}},{id:3152,attributes:{title:b,description:b,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=MNxmDwAAQBAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[a],firstBook:e,published:"1000-01-01",publisher:b,subtitle:b}},{id:3153,attributes:{title:"The Rider of Lost Creek",description:"Lance Kilkenny has a debt to pay, and he isn’t about to let the friend who saved his life go down in a range war. But when Kilkenny tries to stop the fighting, he finds there’s more at stake than land or wire. Whoever is stirring up trouble has big ideas for the Live Oak country—and an army of hired guns to back them up. Nita Riordan, the beautiful and fiery owner of the Apple Canyon Saloon, warns Lance that the mysterious man orchestrating the conflict wants him dead. Lance realizes that if he doesn’t watch his step, he’ll pay the debt he owes with his own blood.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=abM6PwNylLsC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2004-03-30",publisher:d,subtitle:f}},{id:3154,attributes:{title:"Kilkenny",description:"Kilkenny wasn’t looking for trouble when he entered the Clifton House stage station, but trouble found him when a reckless youngster named Tetlow challenged him, drew his gun, and paid for it with his life. Looking to escape a reputation that he never wanted, Kilkenny settles in the lonely mountain country of Utah, planning to ranch a high, lush valley. But the past is on his trail. Jared Tetlow is a powerful rancher determined to run his vast herd on the limited grasslands there—whether he has to buy out the local ranchers, run them out, or kill them. He’ll cut down anyone who stands in his way, especially a man he already despises: the gunman named Kilkenny—the man who killed his son. From the Paperback edition.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=-j8DVQmGgWUC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2003-12-30",publisher:d,subtitle:f}},{id:3155,attributes:{title:"Kilkenny (Louis L'Amour's Lost Treasures)",description:"As part of the Louis L’Amour’s Lost Treasures series, this edition contains exclusive bonus materials! Kilkenny wasn’t looking for trouble when he entered the Clifton House stage station, but trouble found him when a reckless youngster named Tetlow challenged him, drew his gun, and paid for it with his life. Looking to escape a reputation that he never wanted, Kilkenny settles in the lonely mountain country of Utah, planning to ranch a high, lush valley. But the past is on his trail. Jared Tetlow is a powerful rancher determined to run his vast herd on the limited grasslands there—whether he has to buy out the local ranchers, run them out, or kill them. He’ll cut down anyone who stands in his way, especially a man he already despises: the gunman named Kilkenny—the man who killed his son. Louis L’Amour’s Lost Treasures is a project created to release some of the author’s more unconventional manuscripts from the family archives. In Louis L’Amour’s Lost Treasures: Volumes 1, Beau L’Amour takes the reader on a guided tour through many of the finished and unfinished short stories, novels, and treatments that his father was never able to publish during his lifetime. L’Amour’s never-before-seen first novel, No Traveller Returns, faithfully completed for this program, is a voyage into danger and violence on the high seas. These exciting publications will be followed by Louis L’Amour’s Lost Treasures: Volume 2. Additionally, many beloved classics will be rereleased with an exclusive Lost Treasures postscript featuring previously unpublished material, including outlines, plot notes, and alternate drafts. These postscripts tell the story behind the stories that millions of readers have come to know and cherish.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=LhRpDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[a],firstBook:e,published:"2018-08-28",publisher:d,subtitle:f}}]}}},meta:{}}},prerenderedAt:1682568378098}}("Louis L'Amour","","movie","Bantam",null,"A Novel","series",1))